import 'dart:io';
void main() {
  var test_cases = stdin.readLineSync().toString();
  int tc = int.parse("1");
  List<int> main_result = [];
  for (int t = 0; t < tc; t++) {
    var orignal = "";
    List<dynamic> temp = orignal.split("");
    var new_num = "";
    int sum = 0;
    for (int i = 0; i < temp.length; i++) sum += int.parse(temp[i]);
    if ((sum % 9) == 0) {
      new_num += temp[0];
      new_num += "0";
      for (int k = 1; k < orignal.length; k++) new_num += temp[k];
      main_result.add(int.parse(new_num));
    } else {
      int add = 9 - (sum % 9);
      int count = 0;
      for (int i = 0; i < orignal.length; i++) {
        if (int.parse(temp[i]) > add && count == 0) {
          new_num += "" + "$add";
          new_num += temp[i];
          count++;
        } else {
          new_num += temp[i];
        }
        if (i == orignal.length - 1 && count == 0) {
          new_num += "" + "$add";
        }
      }
      main_result.add(int.parse(new_num));
    }
  }
  for (int i = 0; i < tc; i++) print("Case #${i + 1}: ${main_result[i]}");
}